import React from "react";

const YoutubePlaylist = ({ title, onClick }) => {
	// console.log(title);
	return (
		<div className="playlist2" onClick={onClick}>
			<p>{title}</p>
		</div>
	);
};

YoutubePlaylist.defaultProps = {
	title: "Title?",
};

export default YoutubePlaylist;
